const e=["すべて","イベント","住人紹介","生活情報","お知らせ"],a=[{id:1,title:"新しい住人を迎えました！フランスからのアーティスト、マリーさん",excerpt:"パリから大阪にやってきたマリーさん。彼女の作品と日本での生活について聞いてみました。シェアハウスでの国際交流の魅力をたっぷりとお伝えします。",date:"2024年1月15日",category:"住人紹介",image:"https://readdy.ai/api/search-image?query=young%20French%20female%20artist%20smiling%20warmly%20in%20modern%20share%20house%2C%20creative%20atmosphere%2C%20natural%20lighting%2C%20friendly%20portrait%2C%20multicultural%20environment%2C%20lifestyle%20photography%2C%20artistic%20personality%2C%20welcoming%20expression&width=800&height=600&seq=blog001&orientation=landscape",author:"MARUTAKE管理人",readTime:"5分"},{id:2,title:"【イベントレポート】新年会パーティー開催しました",excerpt:"2024年最初のイベントとして新年会を開催。20名以上の住人が集まり、各国の料理を持ち寄って楽しい時間を過ごしました。国際色豊かなパーティーの様子をレポート。",date:"2024年1月10日",category:"イベント",image:"https://readdy.ai/api/search-image?query=diverse%20international%20people%20celebrating%20New%20Year%20party%20together%20in%20modern%20share%20house%2C%20multicultural%20gathering%2C%20food%20on%20table%2C%20warm%20atmosphere%2C%20happy%20celebration%2C%20lifestyle%20photography%2C%20festive%20mood%2C%20genuine%20joy&width=800&height=600&seq=blog002&orientation=landscape",author:"MARUTAKE管理人",readTime:"4分"},{id:3,title:"天王寺エリアのおすすめカフェ5選",excerpt:"MARUTAKE周辺の素敵なカフェをご紹介。勉強やリモートワークにぴったりな場所から、ゆっくりくつろげる隠れ家カフェまで、住人おすすめのスポットをまとめました。",date:"2024年1月5日",category:"生活情報",image:"https://readdy.ai/api/search-image?query=cozy%20modern%20cafe%20interior%20in%20Tennoji%20Osaka%2C%20comfortable%20seating%20area%2C%20natural%20light%20through%20windows%2C%20laptop%20friendly%20workspace%2C%20warm%20inviting%20atmosphere%2C%20contemporary%20Japanese%20cafe%20design%2C%20peaceful%20ambiance&width=800&height=600&seq=blog003&orientation=landscape",author:"MARUTAKE管理人",readTime:"6分"},{id:4,title:"英語と日本語が飛び交う日常 - 国内留学体験談",excerpt:"半年間MARUTAKEで暮らした日本人住人の体験談。英語力がどのように向上したか、異文化交流で得られたものについて語ってもらいました。",date:"2023年12月28日",category:"住人紹介",image:"https://readdy.ai/api/search-image?query=diverse%20people%20having%20animated%20conversation%20mixing%20languages%20in%20modern%20share%20house%20living%20room%2C%20language%20exchange%20atmosphere%2C%20multicultural%20friendship%2C%20warm%20lighting%2C%20natural%20interaction%2C%20lifestyle%20photography%2C%20genuine%20communication&width=800&height=600&seq=blog004&orientation=landscape",author:"MARUTAKE管理人",readTime:"7分"},{id:5,title:"【お知らせ】2月の空室情報とキャンペーン",excerpt:"2月より新しいお部屋が空室となります。今なら初月家賃10%オフのキャンペーン実施中。見学も随時受付中ですので、お気軽にお問い合わせください。",date:"2023年12月20日",category:"お知らせ",image:"https://readdy.ai/api/search-image?query=bright%20empty%20modern%20bedroom%20in%20share%20house%2C%20clean%20minimalist%20design%2C%20large%20window%20with%20natural%20light%2C%20fresh%20new%20room%2C%20inviting%20personal%20space%2C%20contemporary%20interior%2C%20ready%20to%20move%20in%20atmosphere&width=800&height=600&seq=blog005&orientation=landscape",author:"MARUTAKE管理人",readTime:"3分"},{id:6,title:"週末の料理交流会 - 世界の家庭料理を楽しもう",excerpt:"毎月恒例の料理交流会。今月はインド、韓国、イタリア、日本の料理が集まりました。レシピと楽しい交流の様子をお届けします。",date:"2023年12月15日",category:"イベント",image:"https://readdy.ai/api/search-image?query=diverse%20international%20people%20cooking%20together%20in%20modern%20share%20house%20kitchen%2C%20various%20dishes%20from%20different%20countries%2C%20multicultural%20food%20exchange%2C%20warm%20friendly%20atmosphere%2C%20collaborative%20cooking%2C%20lifestyle%20photography%2C%20genuine%20interaction&width=800&height=600&seq=blog006&orientation=landscape",author:"MARUTAKE管理人",readTime:"5分"},{id:7,title:"山王エリアの魅力 - 下町文化と現代の融合",excerpt:"天王寺から徒歩5分の山王エリア。昔ながらの商店街と新しいお店が共存する、温かいコミュニティの魅力をご紹介します。",date:"2023年12月10日",category:"生活情報",image:"https://readdy.ai/api/search-image?query=traditional%20Japanese%20shopping%20street%20Sanno%20area%20Osaka%2C%20local%20shops%20and%20friendly%20atmosphere%2C%20nostalgic%20downtown%20culture%2C%20warm%20community%20feeling%2C%20people%20walking%2C%20authentic%20neighborhood%20scene%2C%20daytime%20photography&width=800&height=600&seq=blog007&orientation=landscape",author:"MARUTAKE管理人",readTime:"6分"},{id:8,title:"ブラジルから来たミュージシャン、カルロスさんの音楽活動",excerpt:"MARUTAKEで暮らしながら音楽活動を続けるカルロスさん。大阪での音楽シーンとシェアハウス生活について語ってもらいました。",date:"2023年12月5日",category:"住人紹介",image:"https://readdy.ai/api/search-image?query=young%20Brazilian%20male%20musician%20with%20guitar%20in%20modern%20share%20house%2C%20creative%20atmosphere%2C%20natural%20lighting%2C%20friendly%20portrait%2C%20artistic%20personality%2C%20multicultural%20environment%2C%20lifestyle%20photography%2C%20passionate%20expression&width=800&height=600&seq=blog008&orientation=landscape",author:"MARUTAKE管理人",readTime:"5分"},{id:9,title:"【イベント予告】2月のバレンタインパーティー開催決定",excerpt:"2月14日にバレンタインパーティーを開催します。各国のチョコレートやスイーツを持ち寄って、楽しい時間を過ごしましょう。参加者募集中です。",date:"2023年12月1日",category:"お知らせ",image:"https://readdy.ai/api/search-image?query=Valentine%20party%20preparation%20in%20modern%20share%20house%2C%20chocolates%20and%20sweets%20on%20table%2C%20festive%20decoration%2C%20warm%20inviting%20atmosphere%2C%20multicultural%20celebration%2C%20lifestyle%20photography%2C%20romantic%20cozy%20ambiance&width=800&height=600&seq=blog009&orientation=landscape",author:"MARUTAKE管理人",readTime:"3分"}];export{a as b,e as c};
